import React, { useState } from 'react';
import './NavBar.css';
import { FaSignInAlt, FaCaretDown } from 'react-icons/fa';
import { NavLink, useNavigate } from 'react-router-dom';

function NavBar() {
  const [isDropdownOpen, setIsDropdownOpen] = useState(false);
  const navigate = useNavigate();

  const handleLogoClick = () => {
    navigate("/");
    setIsDropdownOpen(false);
  };

  const toggleDropdown = () => {
    setIsDropdownOpen(!isDropdownOpen);
  };

  const closeDropdown = () => {
    setIsDropdownOpen(false);
  };

  return (
    <nav className="navbar">
      <div className="navbar-brand" onClick={handleLogoClick}>
        <img src="your-logo-src" alt="Logo" className="navbar-logo" />
        <span className="navbar-heading">CareSaathi</span>
      </div>
      <div className="navbar-items">
        <NavLink to="/" className="nav-item" activeClassName="active" exact onClick={closeDropdown}>
          Care Saathi ChatBot
        </NavLink>
        <NavLink to="/optimize-lab-report" className="nav-item" activeClassName="active" onClick={closeDropdown}>
          Optimize Lab Report
        </NavLink>
        <div className="nav-item dropdown" onMouseEnter={openDropdown} onMouseLeave={closeDropdown}>
          Strategic Healthcare Analytics <FaCaretDown className="dropdown-icon" />
          {isDropdownOpen && (
            <div className="dropdown-content">
              <NavLink to="/image-analytics" className="dropdown-item" activeClassName="active" onClick={closeDropdown}>Image Analytics</NavLink>
              <NavLink to="/extent-prediction" className="dropdown-item" activeClassName="active" onClick={closeDropdown}>Extent Prediction and Preventive Planning</NavLink>
            </div>
          )}
        </div>
        <button className="login-button">
          <FaSignInAlt className="login-icon" />
          Login
        </button>
      </div>
    </nav>
  );
}

export default NavBar;
